import React from 'react';

const FavoritesEmpty = () => {

  return (
    <main className="page__main page__main--subscriptions page__main--subscriptions-empty">
      <div className="page__subscriptions-container container">
        <section className="subscriptions subscriptions--empty">
          <h1 className="visually-hidden">Подписки (пусто)</h1>
          <div className="subscriptions__status-wrapper">
            <b className="subscriptions__status">У вас нет подписок</b>
            <p className="subscriptions__status-description">Подпишитесь на книги, чтобы открыть все главы</p>
          </div>
        </section>
      </div>
    </main>
  );
};

export default FavoritesEmpty;
